(26291, 'etc_spirit_kalie_i00.png', 'Kaliel\'s Energy', 'Longing', 'Use Kaliel\'s Energy to enchant a Talisman - Desire into a Talisman - Insanity. The Talisman - Desire will remain intact even if it fails.', 'Энергия Карли', 'Вожделение', 'Позволяет усилить Талисман Вожделения до Талисмана из Позолоченного Дерева. В случае неудачи Талисман Вожделения сохраняется.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26292, 'etc_rbracelet_aga_agit_i00.png', 'Agathion - Minion Eye', '7-day', 'Can summon Agathion - Minion Eye. You can receive Minion Eye\'s Encouragement (CON + 3, MEN + 3, Weight Gauge + 10000, Max HP/MP/CP/ + 300, Skill Cooldown - 3%, Skill Consumption MP - 3%).<br/>Active Skill: Minion Eye\'s Blessed Resurrection.', 'Браслет Призыва Агатиона: Монстроглаз Шилен', '7 дней', 'Призывает Агатиона Монстроглаза Шилен.</br>Пассивное умение: Поддержка Монстроглаза Шилен: ВЫН+3, ДУХ+3, лимит веса +10000, Макс. HP/MP/CP +300, время перезарядки умений -3%, расход MP для умений -3%.</br>Активное умение: Благ. Воскрешение Монстроглаза Шилен.', 0, 0, 1, 'none', 'consume_type_normal'),
(26293, 'etc_rbracelet_aga_agit_i00.png', 'Agathion - Matryoshka', '7-day', 'Can summon Agathion - Matryoshka.<br/>Active Skill: Teleport to Talking Island Village / Aden / Ancient City Arcan / Keucereus Alliance Base <br/>Matryoshka\'s Gift - Receive a special gift from matryoshka every 12 hours.<br/>Matryoshka\'s Blessing - XP/SP + 30% for 60 minutes.', 'Браслет Призыва Агатиона: Матрешка', '7 дней', 'Призывает Агатиона Матрешку. Активные умения:</br>1. Телепорт Матрешки: телепортирует в Деревню Говорящего Острова / Аден / Древний Город Аркан / Базу Альянса Кецеруса. Время перезарядки: 30 мин.</br>2. Подарок Матрешки: каждые 12 часов можно получить особый подарок от Матрешки.</br>3. Благословение Матрешки: на 60 мин. бонус опыта и SP +30%. Время перезарядки: 5 мин. Эффект суммируется со всеми бонусами к опыту и SP.', 0, 0, 1, 'none', 'consume_type_normal'),
(26294, 'etc_rbracelet_aga_agit_i00.png', 'Agathion - Minion Eye', '30-day', 'Can summon Agathion - Minion Eye. You can receive Minion Eye\'s Encouragement (CON + 3, MEN + 3, Weight Gauge + 10000, Max HP/MP/CP/ + 300, Skill Cooldown - 3%, Skill Consumption MP - 3%).<br/>Active Skill: Minion Eye\'s Blessed Resurrection.', 'Браслет Призыва Агатиона: Монстроглаз Шилен', '30 дней', 'Призывает Агатиона Монстроглаза Шилен.</br>Пассивное умение: Поддержка Монстроглаза Шилен: ВЫН+3, ДУХ+3, лимит веса +10000, Макс. HP/MP/CP +300, время перезарядки умений -3%, расход MP для умений -3%.</br>Активное умение: Благ. Воскрешение Монстроглаза Шилен.', 0, 0, 1, 'none', 'consume_type_normal'),
(26295, 'etc_rbracelet_aga_agit_i00.png', 'Agathion - Matryoshka', '30-day', 'Can summon Agathion - Matryoshka.<br/>Active Skill: Teleport to Talking Island Village / Aden / Ancient City Arcan / Keucereus Alliance Base <br/>Matryoshka\'s Gift - Receive a special gift from matryoshka every 12 hours.<br/>Matryoshka\'s Blessing - XP/SP + 30% for 60 minutes.', 'Браслет Призыва Агатиона: Матрешка', '30 дней', 'Призывает Агатиона Матрешку. Активные умения:</br>1. Телепорт Матрешки: телепортирует в Деревню Говорящего Острова / Аден / Древний Город Аркан / Базу Альянса Кецеруса. Время перезарядки: 30 мин.</br>2. Подарок Матрешки: каждые 12 часов можно получить особый подарок от Матрешки.</br>3. Благословение Матрешки: на 60 мин. бонус опыта и SP +30%. Время перезарядки: 5 мин. Эффект суммируется со всеми бонусами к опыту и SP.', 0, 0, 1, 'none', 'consume_type_normal'),
