(26304, 'g_campfire_flint.png', 'Campfire Flint', NULL, 'You can start a campfire by using this flint. The warmth of the bonfire will decrease Skill Cooldown by 10%, increase PVE Damage by 10%, and bestow the Vampirig Rage effect. It will be effective only when the fire is started at a certain distance away from the village. Does not stack with the Christmas Tree effect.', 'Кремень для Костра', NULL, 'Служит для розжига костра. Тепло костра уменьшает время перезарядки умений на 10%, увеличивает урон в PvE на 10% и дает эффект Гнева Вампира. Необходимо разжигать костер на определенном расстоянии от города, иначе эффекта не будет. Нельзя использовать вместе с эффектом Новогодней Елки.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26305, 'br_kotatsu_i00.png', 'Kotatsu', NULL, 'Increases Speed by 20, and reduces Skill MP Consumption by 20% and PvE Damage by 10%. It will be effective only when summoned at a certain distance away from the village. It lasts 10 minutes. Does not stack with the Christmas Tree effect. ', 'Котацу', NULL, 'Призывает Котацу. Скорость +20, расход MP для умений -20%, получаемый урон в РvE -10%, время действия: 10 мин. Необходимо призывать Котацу на определенном расстоянии от города, иначе эффекта не будет. Нельзя использовать вместе с эффектом Новогодней Елки.', 1, 1, 1, 'none', 'consume_type_stackable'),
