(26332, 'g_scrl_change_chest.png', 'Lineage II Baseball Uniform Appearance Stone', NULL, 'Changes the appearance of the entire armor into that of the Lineage II Baseball Uniform. Can be used as a top or a one piece. It changes everything, making the appearance of all armor into that of the Lineage II Baseball Uniform. Appearance is restored through the use of a Restoration Stone.', 'Камень Обработки Бейсбольной Формы LA2', NULL, 'Позволяет придать доспехам облик бейсбольной формы LA2. Подходит как для нагрудника, так и для полного доспеха. Остальные элементы доспеха также обретают вид бейсбольной формы LA2. Вернуть первоначальный вид можно при помощи Свитка Восстановления Облика Снаряжения.', 1, 1, 1, 'none', 'consume_type_stackable'),
