(26334, 'g_scrl_change_chest.png', 'School Uniform A Appearance Stone', NULL, 'Changes the appearance of the entire armor into that of the School Uniform A. Can be used as a top or a one piece. It changes everything, making the appearance of all armor into that of the School Uniform A. Appearance is restored through the use of a Restoration Stone.', 'Камень Обработки Школьной Формы Тип 1', NULL, 'Позволяет придать доспехам облик Школьной Формы Тип 1. Подходит как для нагрудника, так и для полного доспеха. Остальные элементы доспеха также обретают вид школьной формы 1-го типа. Вернуть первоначальный вид можно при помощи Свитка Восстановления Облика Снаряжения.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26335, 'g_shape_shifting_hair2.png', 'School Uniform Hair A Appearance Stone', NULL, 'Changes the appearance of a hair accessory to that of the School Uniform Hair A. Can only be used on hair accessories that use 2 slots.', 'Камень Обработки Головного Убора Школьной Формы Тип 1', NULL, 'Позволяет придать головному убору облик Головного Убора Школьной Формы Тип 1. Подходит только к головным уборам, занимающим 2 ячейки.', 1, 1, 1, 'none', 'consume_type_stackable'),
