(26338, 'g_therich_i00.png', 'Talisman - Abundance Lv. 1 (High-grade)', NULL, 'Max HP/MP/CP + 510, P. Def. + 971, M. Def. + 552, P. Evasion/M. Evasion + 7, Attribute Resistance + 15, Debuff Resistance + 15%, Received P. Critical Damage - 15%, PVP Damage - 15% when equipped. Can use the Power of Abundance skill. (P. Atk. + 15%, M. Atk. + 15%, Skill Power + 15%, Skill Critical Rate + 15%. Duration 1 minute. Cooldown 10 minutes.)<br/>Note: Effect for the Talisman of Abundance does not stack even when 2 or more are equipped.', 'Талисман Изобилия Высокого Качества - Ур. 1', NULL, 'Макс. HP/MP/CP +510, Физ. Защ. +971, Маг. Защ. +552, Физ. / Маг. Уклонение +7, сопротивление всем стихиям +15, сопротивление отрицательным эффектам +15%, получаемый урон Физ. Крит. Атк. -15%, получаемый урон в PvP -15%. Позволяет использовать умение Сила Изобилия (Физ. Атк. +15%, Маг. Атк. +15%, мощность умений +15%, шанс Крит. Атк. для умений +15%, время действия: 1 мин., перезарядка: 10 мин.)</br>Внимание: при использовании нескольких Талисманов Изобилия эффект не суммируется.', 1, 1, 1, 'none', 'consume_type_normal'),
(26339, 'g_therich_i01.png', 'Talisman - Abundance Lv. 2 (High-grade)', NULL, 'HP/MP/CP + 531, P. Def. + 1051, M. Def. + 609, P. Evasion/M. Evasion + 8, Attribute Resistance + 17, Debuff Resistance + 15%, Received P. Critical Damage - 15%, PVP Damage - 15% when equipped. Can use the Power of Abundance skill. (P. Atk. + 16%, M. Atk. + 16%, Skill Power + 16%, Skill Critical Rate + 16%. Duration 1 minute. Cooldown 10 minutes.)<br/>Note: Effect for the Talisman of Abundance does not stack even when 2 or more are equipped.', 'Талисман Изобилия Высокого Качества - Ур. 2', NULL, 'Макс. HP/MP/CP +531, Физ. Защ. +1051, Маг. Защ. +609, Физ. / Маг. Уклонение +8, сопротивление всем стихиям +17, сопротивление отрицательным эффектам +15%, получаемый урон от Физ. Крит. Атк. -15%, получаемый урон в PvP -15%. Позволяет использовать умение Сила Изобилия (Физ. Атк. +16%, Маг. Атк. +16%, мощность умений +16%, шанс Крит. Атк. для умений +16%, время действия: 1 мин., перезарядка: 10 мин.)</br>Внимание: при использовании нескольких Талисманов Изобилия эффект не суммируется.', 1, 1, 1, 'none', 'consume_type_normal'),
