(26342, 'etc_recipe_black_i00.png', 'Recipe: Talisman - Abundance Lv. 1 (High-grade)', NULL, 'For 4th class only. Recipe for Talisman - Abundance (High-grade) Lv. 1. Requires Create Common Item - Skill Lv. 10. The success rate is 25%. Use offerings to increase the success rate to 100%.', 'Рецепт: Талисман Изобилия Высокого Качества - Ур. 1', NULL, 'Доступно всем классам, получившим 4-ю профессию. Рецепт для создания Талисмана Изобилия Высокого Качества 1-го уровня. Требуется умение \"Создать Обычный Предмет\" 10-го уровня. Шанс успеха 25%. Если внести пожертвование, то шанс успеха увеличится до 100%.', 1, 1, 1, 'none', 'consume_type_stackable'),
