(26344, 'etc_recipe_black_i00.png', 'Recipe: Talisman - Abundance Lv. 3 (High-grade)', NULL, 'For 4th class only. Recipe for Talisman - Abundance (High-grade) Lv. 3. Requires Create Common Item - Skill Lv. 10. The success rate is 25%. Use offerings to increase the success rate to 100%.', 'Рецепт: Талисман Изобилия Высокого Качества - Ур. 3', NULL, 'Доступно всем классам, получившим 4-ю профессию. Рецепт для создания Талисмана Изобилия Высокого Качества 3-го уровня. Требуется умение \"Создать Обычный Предмет\" 10-го уровня. Шанс успеха 25%. Если внести пожертвование, то шанс успеха увеличится до 100%.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26345, 'etc_recipe_black_i00.png', 'Recipe: Talisman - Abundance Lv. 4 (High-grade)', NULL, 'For 4th class only. Recipe for Talisman - Abundance (High-grade) Lv. 4. Requires Create Common Item - Skill Lv. 10. The success rate is 25%. Use offerings to increase the success rate to 100%.', 'Рецепт: Талисман Изобилия Высокого Качества - Ур. 4', NULL, 'Доступно всем классам, получившим 4-ю профессию. Рецепт для создания Талисмана Изобилия Высокого Качества 4-го уровня. Требуется умение \"Создать Обычный Предмет\" 10-го уровня. Шанс успеха 25%. Если внести пожертвование, то шанс успеха увеличится до 100%.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26346, 'etc_taiwan_bag_i00.png', 'Kaliel\'s Wish Pouch', NULL, 'Double-click to receive 3 Kaliel\'s Wishes. Deleted after event.', 'Красный Бао', NULL, 'Если щелкнуть два раза можно получить 3 Желания Карли. Предмет будет удален после окончания ивента.', 0, 0, 0, 'none', 'consume_type_stackable'),
(26347, 'event_upgradegold.png', 'Kaliel\'s Token', NULL, 'Kaliel\'s Token. Give it to Jolie (Event Manager) to receive a Gift Box or Soul Box. Deleted after event.', 'Золотой Вонб', NULL, 'Золотой Вонб. Можно обменять у Джолли на Сундук Подарков Карли или на Сундук Души Карли. Предмет будет удален после окончания ивента.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26348, 'newyear_lucky_bag3.png', 'Kaliel\'s Soul Pouch', NULL, 'Double-click to receive various items with Kaliel\'s Blessing that are helpful for obtaining XP and hunting. Temporary event item.', 'Мешочек с Душой Карли', NULL, 'Дважды щелкните, чтобы получить разнообразные благословенные предметы Карли, которые помогут в получении очков опыта. Предмет будет удален после окончания ивента.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26349, 'newyear_lucky_bag3.png', 'Kaliel\'s Gift Box Pouch', NULL, 'Double-click to receive various valuable items with Kaliel\'s Blessing. Temporary event item.', 'Мешочек с подарками Карли', NULL, 'Дважды щелкните, чтобы получить разнообразные благословенные предметы Карли. Предмет будет удален после окончания ивента.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26350, 'etc_scroll_of_enchant_weapon_i04.png', 'Scroll: Enchant Weapon (A-grade)', NULL, 'When enchanted, P. Atk. + 4 for one-handed swords/ blunts, daggers, spears, etc. (A-grade). P. Atk. + 5 for two-handed swords/ blunts, dualswords, and two-handed fist weapons. P. Atk. + 8 for bows. M. Atk. + 3 for all weapons. P. Atk./M. Atk. Increase doubles starting at + 4.', 'Свиток: Модифицировать Оружие (А)', NULL, 'Для модификации оружия Ранга А. Одноручный меч, одноручное дробящее, кинжал, древковое: Физ. Атк. +4. Двуручный меч, двуручное дробящее, парные клинки, кастеты: Физ. Атк. +5. Луки: Физ. Атк. +8. Все оружие: Маг. Атк. +3. При модификации на +4 и выше бонус к Физ. Атк. и Маг. Атк. удваивается. Безопасная модификация: +3.', 0, 0, 1, 'none', 'consume_type_stackable'),
(26351, 'etc_scroll_of_enchant_armor_i04.png', 'Scroll: Enchant Armor (A-grade)', NULL, 'When enchanted, P. Def. + 1 for armor and accessories (A-grade). Increases by 3 starting from + 4. It can safely be enchanted up to + 3. For one-piece armor, it can safely be enchanted up to + 4. HP gradually increases with each enchant level starting from + 4.', 'Свиток: Модифицировать Доспех (А)', NULL, 'Для модификации доспехов и аксессуаров Ранга A. Дает Физ. Защ. +1. При модификации на +4 и выше дает Физ. Защ. +3. Безопасная модификация: обычный доспех +3, полный доспех +4.', 0, 0, 1, 'none', 'consume_type_stackable'),
(26352, 'etc_scroll_of_enchant_weapon_i05.png', 'Scroll: Enchant Weapon (S-grade)', NULL, 'When enchanted, P. Atk. + 5 for one-handed swords/ blunts, daggers, spears, etc. (S-grade). P. Atk. + 6 for two-handed swords/ blunts, dualswords, and two-handed fist weapons. P. Atk. + 10 for bows. M. Atk. + 4 for all weapons. P. Atk./M. Atk. Increase doubles starting at + 4.', 'Свиток: Модифицировать Оружие (S)', NULL, 'Для модификации оружия Ранга S. Одноручный меч, одноручное дробящее, кинжал, древковое: Физ. Атк. +5. Двуручный меч, двуручное дробящее, парные клинки, кастеты: Физ. Атк. +6. Луки: Физ. Атк +10. Все оружие: Маг. Атк. +4. При модификации на +4 и выше бонус к Физ. Атк. и Маг. Атк. удваивается.', 0, 0, 1, 'none', 'consume_type_stackable'),
(26353, 'etc_scroll_of_enchant_armor_i05.png', 'Scroll: Enchant Armor (S-grade)', NULL, 'P. Def. + 1 for armor and accessories (S-grade). Increases by 3 starting from + 4. It can safely be enchanted up to + 3. For one-piece armor, it can safely be enchanted up to + 4. HP gradually increases with each enchant level starting from + 4.', 'Свиток: Модифицировать Доспех (S)', NULL, 'Для модификации доспехов и аксессуаров Ранга S. Дает Физ. Защ. +1. При модификации на +4 и выше дает Физ. Защ. +3. Безопасная модификация: обычный доспех +3, полный доспех +4.', 0, 0, 1, 'none', 'consume_type_stackable'),
(26354, 'etc_talisman_energy_i01.png', 'Gem', NULL, 'Used as an ingredient to purchase items from the in-game shop.', 'Драгоценный Камень', NULL, 'Используется для покупки предметов в Игровом Магазине.', 0, 0, 1, 'none', 'consume_type_stackable'),
(26355, 'g_co_captain_i00.png', 'Pirate Captain Outfit', NULL, 'Pirate captain\'s outfit. When equipped, armor is removed and cannot be used. Hair accessories, weapons, and magic armor are not removed. ', 'Костюм Капитана Пиратов', NULL, 'При надевании отменяет эффект доспехов, но сохраняет эффект головного убора, оружия и магических доспехов.', 1, 0, 1, 'none', 'consume_type_normal'),
(26356, 'g_co_pirate_i00.png', 'Pirate Crew Outfit', NULL, 'Pirate crew member\'s outfit. When equipped, armor is removed and cannot be used. Hair accessories, weapons, and magic armor are not removed. ', 'Костюм Пирата', NULL, 'При надевании отменяет эффект доспехов, но сохраняет эффект головного убора, оружия и магических доспехов.', 1, 0, 1, 'none', 'consume_type_normal'),
(26357, 'g_scrl_change_chest.png', 'Pirate Captain Appeareance Stone', NULL, 'Changes the appearance of the entire armor into that of a Pirate Captain. Can be used as a top or a one piece. It changes everything, making the appearance of all armor into that of a Pirate Captain. Appearance is restored through the use of a Restoration Stone.', 'Камень Обработки Костюма Капитана Пиратов', NULL, 'Придает персонажу облик капитана пиратов. Подходит как для нагрудника, так и для полного доспеха. Остальные элементы доспеха также обретают вид Костюма Капитана Пиратов. Вернуть первоначальный вид можно при помощи Свитка Восстановления Облика Снаряжения.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26358, 'g_scrl_change_chest.png', 'Pirate Crew Appeareance Stone', NULL, 'Changes the appearance of the entire armor into that of a Pirate Crew member. Can be used as a top or a one piece. It changes everything, making the appearance of all armor into that of a Pirate Crew member. Appearance is restored through the use of a Restoration Stone.', 'Камень Обработки Костюма Пирата', NULL, 'Придает персонажу облик пирата. Подходит как для нагрудника, так и для полного доспеха. Остальные элементы доспеха также обретают вид Костюма Пирата. Вернуть первоначальный вид можно при помощи Свитка Восстановления Облика Снаряжения.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26359, 'g_auto_shape_shift_stone.png', 'Automatic Appearance Stone: Tears Weapon', '30-day', 'Changes the appearance of all weapons into those of Tears Weapons of corresponding types for 30 days. Can be used on shields and sigils. Double-click to use.<br/><br/>Note: Appearance may reset when the Change Weapon skill is used.', 'Камень Автоматической Обработки Оружия Слез', '30 дней', 'Витаминный предмет</br>На 30 дней придает оружию вид аналогичного оружия Слез, включая щиты и символы. Используется двойным щелчком, как и обычный Камень Обработки.</br></br></br></br>Внимание: при конверсии внешний вид оружия вернется к первоначальному.', 0, 0, 1, 'none', 'consume_type_stackable'),
(26360, 'g_auto_shape_shift_stone.png', 'Automatic Appearance Stone: Tears Weapon', NULL, 'Changes the appearance of all weapons into those of Tears Weapons of corresponding types. Can be used on shields and sigils. Double-click to use.<br/><br/>Note: Appearance may reset when the Change Weapon skill is used.', 'Камень Автоматической Обработки Оружия Слез', NULL, 'Витаминный предмет</br>Придает оружию вид аналогичного оружия Слез, включая щиты и символы. Используется двойным щелчком, как и обычный Камень Обработки.</br></br></br></br>Внимание: при конверсии внешний вид оружия вернется к первоначальному.', 0, 0, 1, 'none', 'consume_type_stackable'),
(26361, 'g_shape_shifting_hair2.png', 'Metal Suit Hair Accessory Appearance Stone', '30-day', 'Changes the appearance of a hair accessory into that of a Metal Suit for 30 days. Can be used only on hair accessories that take up 2 slots.', 'Камень Обработки Шлема Киберкостюма', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать головному убору вид Шлема Киберкостюма. Подходит только к головным уборам, занимающим 2 ячейки.', 0, 0, 1, 'none', 'consume_type_stackable'),
(26362, 'g_scrl_change_chest.png', 'Metal Suit Top Appearance Stone', '30-day', 'Changes the appearance of a top into that of a Metal Suit for 30 days. An appearance-modified item has no change in abilities. All armor types. Modifying the full set creates a new skill.', 'Камень Обработки Нагрудника Киберкостюма', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать нагруднику вид Нагрудника Киберкостюма. После обработки параметры не меняются. Не требуется предмет-прототип. Добавляет новое умение при модификации верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26363, 'g_scrl_change_legs.png', 'Metal Suit Pants Appearance Stone', '30-day', 'Changes the appearance of pants into that of a Metal Suit for 30 days. An appearance-modified item has no change in abilities. All armor types. Modifying the full set creates a new skill.', 'Камень Обработки Набедренников Киберкостюма', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать набедренникам вид Набедренников Киберкостюма. После обработки параметры не меняются. Не требуется предмет-прототип. Добавляет новое умение при модификации верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26364, 'g_scrl_change_gloves.png', 'Metal Suit Gloves Appearance Stone', '30-day', 'Changes the appearance of gloves into that of a Metal Suit fpr 30 days. An appearance-modified item has no change in abilities. Modifying the full set creates a new skill.', 'Камень Обработки Перчаток Киберкостюма', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать перчаткам вид Перчаток Киберкостюма. Не требуется предмет-прототип. Добавляет новое умение при обработке верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26365, 'g_scrl_change_feet.png', 'Metal Suit Shoes Appearance Stone', '30-day', 'Changes the appearance of shoes into that of a Metal Suit for 30 days. An appearance-modified item has no change in abilities. Modifying the full set creates a new skill.', 'Камень Обработки Ботинок Киберкостюма', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать обуви вид Ботинок Киберкостюма. Не требуется предмет-прототип. Добавляет новое умение при обработке верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26366, 'g_shape_shifting_hair2.png', 'Ninja Hair Accessory Appearance Stone', '30-day', 'Changes the appearance of a hair accessory into that of a Ninja Outfit for 30 days. Can be used only on hair accessories that take up 2 slots. Gives you active skills upon modification.', 'Камень Обработки Маски Ниндзя', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать головному убору вид Маски Ниндзя. Подходит только к головным уборам, занимающим 2 ячейки.', 0, 0, 1, 'none', 'consume_type_stackable'),
(26367, 'g_scrl_change_chest.png', 'Ninja Top Appearance Stone', '30-day', 'Changes the appearance of a top into that of a Ninja Outfit for 30 days. An appearance-modified item has no change in abilities. All armor types. Gives you passive skills upon modification of top, pants, gloves, and shoes.', 'Камень Обработки Туники Ниндзя', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать нагруднику вид Туники Ниндзя. После обработки параметры не меняются. Не требуется предмет-прототип. Добавляет новое умение при модификации верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26368, 'g_scrl_change_legs.png', 'Ninja Pants Appearance Stone', '30-day', 'Changes the appearance of a top into that of a Ninja Outfit for 30 days. An appearance-modified item has no change in abilities. All armor types. Gives you passive skills upon modification of top, pants, gloves, and shoes.', 'Камень Обработки Штанов Ниндзя', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать набедренникам вид Штанов Ниндзя. После обработки параметры не меняются. Не требуется предмет-прототип. Добавляет новое умение при модификации верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26369, 'g_scrl_change_gloves.png', 'Ninja Gloves Appearance Stone', '30-day', 'Changes the appearance of a top into that of a Ninja Outfit for 30 days. An appearance-modified item has no change in abilities. Gives you passive skills upon modification of top, pants, gloves, and shoes.', 'Камень Обработки Перчаток Ниндзя', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать перчаткам вид Перчаток Ниндзя. Не требуется предмет-прототип. Добавляет новое умение при обработке верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26370, 'g_scrl_change_feet.png', 'Ninja Shoes Appearance Stone', '30-day', 'Changes the appearance of a top into that of a Ninja Outfit for 30 days. An appearance-modified item has no change in abilities. Gives you passive skills upon modification of top, pants, gloves, and shoes.', 'Камень Обработки Ботинок Ниндзя', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать обуви вид Ботинок Ниндзя. Не требуется предмет-прототип. Добавляет новое умение при обработке верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26371, 'g_shape_shifting_hair2.png', 'Tribal Warrior Hair Accessory Appearance Stone', '30-day', 'Changes the appearance of a hair accessory to that of a Tribal Warrior outfit for 30 days. Can only be used on hair accessories that use 2 slots.', 'Камень Обработки Национального Тайваньского Головного Убора', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать головному убору вид Национального Тайваньского Головного Убора. Подходит только к головным уборам, занимающим 2 ячейки.', 0, 0, 1, 'none', 'consume_type_stackable'),
