(26377, 'g_scrl_change_chest.png', 'Military Top Appearance Stone', '30-day', 'Changes the appearance of a top into that of a Military look for 30 days. An appearance-modified item has no change in abilities. All armor types. Gives you passive skills upon modification of top, pants, gloves, and shoes.', 'Камень Обработки Мундира Солдата', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать нагруднику вид Мундира Солдата. После обработки параметры не меняются. Не требуется предмет-прототип. Добавляет новое умение при модификации верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
(26378, 'g_scrl_change_legs.png', 'Military Pants Appearance Stone', '30-day', 'Changes the appearance of a top into that of a Military look for 30 days. An appearance-modified item has no change in abilities. All armor types. Gives you passive skills upon modification of top, pants, gloves, and shoes.', 'Камень Обработки Штанов Солдата', '30 дней', 'Витаминный предмет</br>Позволяет на 30 дней придать набедренникам вид Штанов Солдата. После обработки параметры не меняются. Не требуется предмет-прототип. Добавляет новое умение при модификации верха, низа, перчаток, обуви.', 1, 1, 1, 'none', 'consume_type_stackable'),
