(26455, 'g_therich_i00.png', 'Talisman - Abundance Lv. 1 (High-grade)', NULL, 'Max HP/MP/CP + 510, P. Def. + 971, M. Def. + 552, P. Evasion/M. Evasion + 7, Attribute Resistance + 15, Debuff Resistance + 15%, Received P. Critical Damage - 15%, PVP Damage - 15% when equipped. Can use the Power of Abundance skill. (P. Atk. + 15%, M. Atk. + 15%, Skill Power + 15%, Skill Critical Rate + 15%. Duration 1 minute. Cooldown 10 minutes.)<br/>Note: Effect for the Talisman of Abundance does not stack even when 2 or more are equipped.', 'Талисман Изобилия Высокого Качества - Ур. 1', NULL, 'Макс. HP/MP/CP +510, Физ. Защ. +971, Маг. Защ. +552, Физ. / Маг. Уклонение +7, сопротивление всем стихиям +15, сопротивление отрицательным эффектам +15%, получаемый урон Физ. Крит. Атк. -15%, получаемый урон в PvP -15%. Позволяет использовать умение Сила Изобилия (Физ. Атк. +15%, Маг. Атк. +15%, мощность умений +15%, шанс Крит. Атк. для умений +15%, время действия: 1 мин., перезарядка: 10 мин.)</br>Внимание: при использовании нескольких Талисманов Изобилия эффект не суммируется.', 1, 1, 1, 'none', 'consume_type_normal'),
