(26467, 'etc_pi_gift_box_i03.png', 'Abundance Box', NULL, 'Get 1 of the following:  1 type of Talisman - Abundance, Seven Signs\' Energy, Antharas\' Earring, Talisman - Lilith, Talisman - Anakim, Baium\'s Soul Ring, Valakas\' Necklace, Bottle of Antharas\' Soul, Bottle of Valakas\' Soul, Baium\'s Ring, Octavis\' Ring, Bottle of Queen Ant\'s Soul, Istina\'s Earring, Queen Ant\'s Ring, Istina\'s Necklace, Bottle of Orfen\'s Soul, Octavis\' Earring, Istina\'s Earring, Octavis\' Necklace, Immortal Scroll Chapter 1, Superior Giant\'s Codex - Mastery Chapter 1, Superior Giant\'s Codex Chapter 1, Lv. 5 Legendary Dye Pack, Elcyum x2, Superior Giant\'s Codex - Discipline Chapter 1, Giant\'s Energy x10, Orfen\'s Earring, Elcyum Crystal x5, Tempest Stone, Gemstone (R-grade) x30, 1 of 2 Fortune Pocket - Stage 5.', 'Сундук Изобилия', NULL, 'С определенной вероятностью можно получить один из предметов: Талисман Изобилия, Энергия Семи Печатей, Серьга Антараса, Талисман Лилит / Анаким, Кольцо Души Баюма, Ожерелье Валакаса, Бутыль с Душой Антараса / Валакаса, Кольцо Баюма, Кольцо Октависа, Бутыль с Душой Королевы Муравьев, Серьга Истхины, Кольцо Королевы Муравьев, Ожерелье Истхины, Бутыль с Душой Орфен, Серьга Октависа, Кольцо Истхины, Ожерелье Октависа, Кодекс Постоянства Глава 1, Кодекс Перерождения - Мастерство Глава 1, Кодекс Перерождения Глава 1, Коробка с Легендарной Краской Ур. 5, Эльсиум (2 шт.), Кодекс Перерождения - Дисциплина Глава 1, Сила Гигантов (10 шт.), Серьга Орфен, Кристалл Эльсиума (5 шт.), Тяжелый Камень Ветра, Самоцвет: Ранг R (30 шт.), Мешочек Кладоискателя - Ур. 5 (2 шт.)', 1, 1, 1, 'none', 'consume_type_stackable'),
(26468, 'accessory_earring_of_lind_i00.png', 'Lindvior\'s Earring', '3-day', 'MP + 59, Petrification and Resistance to it + 50%, Knock Back/Knock Down and Resistance to it + 40%, Pulling and Resistance to it + 40%, P. Critical Damage + 10%, M. Critical Damage + 10%, P./M. Abnormal Status Reflection + 10%. Reflect damage magic back to the attacker with the probability of 10%. Movement Speed + 5, DEX + 3, and WIT + 3. Increases Wind/Dark Resistance. Enables the skill of cancelling Knock Back/Knock Down and increases Knock Back/Knock Down Resistance to 100% instantly. When two identical earrings are equipped, only one effect is applied.', 'Серьга Линдвиора', '3 дн.', 'MP +59, шанс обратить в камень и сопротивление окаменению +50%, шанс отталкивания / опрокидывания и сопротивление отталкиванию / опрокидыванию +40%, шанс притягивания и сопротивление притягиванию +40%, сила Физ. Крит. Атк. +10%, сила Маг. Крит. Атк. +10%, шанс отразить физ. / маг. отрицательные эффекты +10%, с 10% вероятностью отражает магический урон. Скорость +5, ЛВК +3, МДР +3, увеличение сопротивления тьме / ветру. Позволяет использовать умение, рассеивающие отталкивание / опрокидывание, а так же дающее иммунитет к отталкиванию / опрокидыванию. При надевании двух таких серег эффект не суммируется.', 0, 0, 1, 'r', 'consume_type_normal'),
