(27374, 'g_scrl_change_chest.png', 'Pirate Captain Appeareance Stone', 'Low-grade / Debuff Reflect', 'Changes the appearance of the entire armor into that of a Pirate Captain. Can be used as a top or a one piece. It changes everything, making the appearance of all armor into that of a Pirate Captain. Appearance is restored through the use of a Restoration Stone. When modified, Debuff Reflect + 3%.', 'Камень Обработки Костюма Капитана Пиратов', 'Низкое качество / Отражение Отрицательных Эффектов', 'Придает персонажу облик пирата. Подходит как для нагрудника, так и для полного доспеха. Остальные элементы доспеха также обретают вид Костюма Капитана Пиратов. Вернуть первоначальный вид можно при помощи Свитка Восстановления Облика Снаряжения. Отражение отрицательных эффектов +3%.', 1, 1, 1, 'none', 'consume_type_stackable'),
